	public static String reverseOnlyLetters(String s) {
		int l = 0;
		int r = s.length() - 1;
		char[] chars = s.toCharArray();

		while (l < r) {
			char lc = chars[l];
			char rc = chars[r];

			if (!Character.isLetter(lc) && !Character.isLetter(rc)) {
				l++;
				r--;
				continue;
			}

			while (!Character.isLetter(lc)) {
				l++;
				lc = chars[l];
			}

			while (!Character.isLetter(rc)) {
				r--;
				rc = chars[r];
			}

			if (l < r) {
				chars[r] = lc;
				chars[l] = rc;
				l++;
				r--;
			}
		}

		return new String(chars);
	}

	public static double findMaxAverage1(int[] nums, int k) {
		double sum = 0;
		for (int i = 0; i < k; i++)
			sum += nums[i];
		double res = sum;
		for (int i = k; i < nums.length; i++) {
			sum += nums[i] - nums[i - k];
			res = Math.max(res, sum);
		}
		return res / k;
	}

	public static double findMaxAverage(int[] nums, int k) {
		int[] sums = new int[nums.length];

		for (int i = 1; i < nums.length; i++) {
			sums[i] = nums[i - 1] + nums[i];
		}

		double res = sums[k - 1] * 1.0 / k;

		for (int i = k; i < nums.length; i++) {
			res = Math.max(res, (sums[i] - sums[i - k]) * 1.0 / k);
		}

		return res;
	}

	public static int findSubArrayLength(int arr[], int total) {
		int l = 0;
		int curr = 0;
		int result = 0;

		for (int r = 0; r < arr.length; r++) {
			curr += arr[r];

			if (curr > total) {
				curr -= arr[l];
				l++;
			}

			result = Math.max(result, r - l + 1);
		}

		log.info(Arrays.toString(arr) + " with left:" + l + " length:" + result);

		int[] subarr = Arrays.copyOfRange(arr, l - 1, (l - 1) + result);

		log.info(Arrays.toString(subarr) + " with length:" + subarr.length);
		return result;
	}

	public static void reverseString(char[] s) {
		int l = 0;
		int r = s.length - 1;

		while (l < r) {
			char t = s[l];
			s[l] = s[r];
			s[r] = t;
			l++;
			r--;
		}
	}

	 public static int getCommon(int[] nums1, int[] nums2) {
	        int first = 0;
	        int second = 0;

	        while (first < nums1.length && second < nums2.length) {
	            if (nums1[first] < nums2[second]) {
	                first++;
	            } else if (nums1[first] > nums2[second]) {
	                second++;
	            } else {
	                return nums1[first];
	            }
	        }
	        return -1;
	    }
	 
	public static void moveZeroes(int[] nums) {
		int nonzero = 0;

		for (int i = 0; i < nums.length; i++) {
			if (nums[i] != 0) {
				int temp = nums[i];
				nums[i] = nums[nonzero];
				nums[nonzero] = temp;
				nonzero++;
			}
		}
	}

	public static int[] twoSum(int[] numbers, int target) {
		int l = 0;
		int r = numbers.length - 1;
		int[] indexes = new int[2];

		while (l < r) {
			int sum = numbers[l] + numbers[r];
			log.info("current sum of:" + numbers[l] + " and " + numbers[r] + " is:" + sum);

			if (sum == target) {
				indexes[0] = l;
				indexes[1] = r;
				return indexes;
			}

			if (sum > target) {
				r--;
			}

			if (sum < target) {
				l++;
			}
		}

		indexes[0] = 0;
		indexes[1] = 0;
		return indexes;
	}

	/*
	 * Example 2: Given a sorted array of unique integers and a target integer,
	 * return true if there exists a pair of numbers that sum to target, false
	 * otherwise. This problem is similar to Two Sum. (In Two Sum, the input is not
	 * sorted). For example, given nums = [1, 2, 4, 6, 8, 9, 14, 15] and target =
	 * 13, return true because 4 + 9 = 13.
	 */

	/*
	 * Let's use the example input. With two pointers, we start by looking at the
	 * first and last numbers. Their sum is 1 + 15 = 16. Because 16 > target, we
	 * need to make our current sum smaller. Therefore, we should move the right
	 * pointer. Now, we have 1 + 14 = 15. Again, move the right pointer because the
	 * sum is too large. Now, 1 + 9 = 10. Since the sum is too small, we need to
	 * make it bigger, which can be done by moving the left pointer. 2 + 9 = 11 <
	 * target, so move it again. Finally, 4 + 9 = 13 = target.
	 * 
	 * 
	 */
	private static boolean isContainsSum(int[] nums, int target) {
		int l = 0;
		int r = nums.length - 1;
		while (l < r) {
			int sum = nums[l] + nums[r];
			log.info("current sum:" + nums[l] + " and " + nums[r] + " and:" + sum);

			if (sum > target) {
				r--;
			}
			if (sum < target) {
				l++;
			}

			if (sum == target) {
				return true;
			}
		}

		return false;
	}

