	// Example 1: Given a string s, return true if it is a palindrome, false
	// otherwise.
	private static boolean isPalidrome(String word) {
		int l = 0;
		int r = word.length() - 1;

		while (l < r) {
			if (word.charAt(l) != word.charAt(r)) {
				return false;
			}
			l++;
			r--;
		}

		return true;
	}

